*/ 
const {Header, Footer, Sider, Content} = Layout

export default class Admin extends Component {
  render() {
    const userdata = memoryUtils.userdata 
    if(!userdata || userdata.status!=='0'){
      message.error("请先的登录！")
      return <Redirect to='/login'/>
    }
    return ( 
      <div>
        你好！
      </div>
     );
  }
}
